const BullContainer = (props) => {

  return (
      <div tabIndex="0" className="upper symbol-box" data-index="${i}">
        <h2 id="symbol">{props.data.name}</h2>
        <p className="price price-up-${i}">Price: ${props.data.price}</p>
        <div className="changes-row">
          <p className="changePercentageUp-${i}">${props.data.percentage}%</p>
          <img id="upArrow" src="./images/upArrow.svg"/>
          <p>${props.data.change}</p>
        </div>
      </div>
  );
};

export default BullContainer;
